import React, { useState } from "react";
import ReactDOM from "react-dom";
import Button from "./Button";

import Testimonialone from "./Testimonialone";
import Testimonialtwo from "./Testimonialtwo";



function App() {


  const [moveLeft,setMoveLeft]= useState({position1:"translateX(0%)",
})
  return (
    <main className="container">
      <section className="slider">
        <Testimonialone />
        <Button setMoveLeft={setMoveLeft}/>
        <Testimonialtwo moveLeft={moveLeft}/>
      </section>
    </main>
  );
}

export default App;
